var _value = {},
	_monthNames = [
		"Jänner",
		"Februar",
		"März",
		"April",
		"Mai",
		"Juni",
		"Juli",
		"August",
		"September",
		"Oktober",
		"November",
		"Dezember"
	],
	_dayOfTheWeekNames = [
		"Sonntag",
		"Montag",
		"Dienstag",
		"Mittwoch",
		"Donnerstag",
		"Freitag",
		"Samstag"
	],
	_buttonValues = {};

function updateButtons() {
	// get first displayed day
	var currentDate = new Date(_value.raw);
	currentDate.setDate(0);
	var dOW = currentDate.getDay();

	while (dOW != 1) {
		currentDate.setDate(currentDate.getDate() - 1);
		dOW = currentDate.getDay();
	}

	var initialUpdate = _buttonValues['00'] === undefined;
	for (var y = 0; y < 6; y++) { // for each row
		for (var x = 0; x < 7; x++) { // and each column
			var id = y + '' + x,
				fieldId = 'field_' + id,
				labelId = fieldId + '_button_label',
				bgId = fieldId + '_button_bg';

			// set label
			webMI.gfx.setText(labelId, currentDate.getDate());

			// draw today indicator
			if (currentDate.getMonth() == _value.month && currentDate.getDate() == _value.day) {
				webMI.gfx.setFill(labelId, window.theme.getValue('ControlBackgroundColor'));
				webMI.gfx.setFill(bgId, window.theme.getValue('ControlTintColor'));
			}
			else {
				var now = new Date();
				webMI.gfx.setFill(labelId, window.theme.getValue(
					(currentDate.getMonth() == now.getMonth() && currentDate.getDate() == now.getDate() && currentDate.getFullYear() == now.getFullYear()) ? 'ControlTintColor' :
					(currentDate.getMonth() == _value.month) ? 'ControlTextColor' : 'ControlLabelColor'));
				webMI.gfx.setFill(bgId, 'none');
			}

			// set action
			if (initialUpdate)
				(function() {
					var _id = id;

					webMI.trigger.connect('clicked', function(e) {
						if (_buttonValues[_id] != _value.raw) setValue(_buttonValues[_id])
					}, fieldId);
				})();

			// save date
			_buttonValues[id] = currentDate.valueOf();

			// select next date
			currentDate.setDate(currentDate.getDate() + 1);
		}
	}
}

function setValue(timestamp) {
	var millis = 0;

	//check if a value is given
	if (timestamp) {
		millis = timestamp;

		//if not number, try to parse
		if (typeof millis != "number") {
			millis = parseInt(timestamp, 10);

			if (isNaN(millis)) {
				millis = 0;
			}
		}
	}

	//set new date
	var newDate = new Date(millis);
	_value.raw = millis;
	_value.day = newDate.getDate();
	_value.dayOfTheWeek = newDate.getDay();
	_value.month = newDate.getMonth();
	_value.year = newDate.getFullYear();
	_value.hours = newDate.getHours();
	_value.minutes = newDate.getMinutes();
	_value.seconds = newDate.getSeconds();
	_value.millis = newDate.getMilliseconds();

	// update buttons
	updateButtons();

	// update labels
	updateLabels();

	//webMI.data.write([webMI.query.base], [timestamp]);
}

function updateLabels() {
	/*webMI.gfx.setText('yearLabel', _value.year);
	webMI.gfx.setText('monthLabel', _monthNames[_value.month]);*/
	webMI.gfx.setText('yearLabelLeft', _value.year);
	webMI.gfx.setText('dayOfTheWeekLabel', _dayOfTheWeekNames[_value.dayOfTheWeek] + ',');
	webMI.gfx.setText('numericDateLabel', new Date(_value.raw).toLocaleDateString());

	webMI.trigger.fire('setSelectedItem', _monthNames[_value.month], 'monthInput');
	webMI.trigger.fire('setValue', _value.year, 'yearInput');
}

webMI.addOnload(function() {
//	setValue(webMI.query.value);
	setValue((new Date()).valueOf());
	webMI.trigger.fire("com.atvise.datepicker_" + popupId, _value.raw);
});

webMI.trigger.connect('setValue', function(e) {
	setValue(e.value);
})

// Back / Forward buttons
webMI.addEvent('goBackClickarea', ['mouseup', 'touchend'], function(e) {
	var newValue = new Date(_value.raw);
	newValue.setMonth(newValue.getMonth() - 1);
	setValue(newValue.valueOf());
});

webMI.addEvent('goForwardClickarea', ['mouseup', 'touchend'], function(e) {
	var newValue = new Date(_value.raw);
	newValue.setMonth(newValue.getMonth() + 1);
	setValue(newValue.valueOf());
});

// Month input
webMI.trigger.fire('setItems', (function() {
	var items = [];
	for (var i in _monthNames) {
		items.push({ text: _monthNames[i], value: i });
	}

	return items;
})(), 'monthInput');

webMI.trigger.connect('valuechanged', function(e) {
	if (e.value == _value.month) return;

	var newDate = new Date(_value.raw);
	newDate.setMonth(e.value);
	setValue(newDate.valueOf());
}, 'monthInput');

// Year input
webMI.trigger.connect('valuechanged', function(e) {
	if (!_value.raw || e.value == _value.year || _value.year && e.value == '') return;

	var newDate = new Date(_value.raw);
	newDate.setFullYear(e.value);
	setValue(newDate.valueOf());
}, 'yearInput');

// Okay button
webMI.trigger.connect("clicked", function() {
	webMI.trigger.fire("com.atvise.datepicker_" + popupId, _value.raw);
	webMI.display.closeWindow(); 
}, "id_3");

// 'Now' Button
webMI.trigger.connect("clicked", function(e) {
	setValue((new Date()).valueOf());
}, "nowButton");
